import React,{useState}from 'react'
import NeutralButton from '../ButtonNeutral/NeutralButton'

export default function RegisterForm() {
  const [registerData, setData] = useState({
    name: '',
    email: '',
    password: ''
  });


  return (
    <div>

        <h3>Register Form</h3>
            <form>

            <label htmlFor="name">Name</label>
                <input placeholder= "Jane Doe" type="text" name="name"/>

                <label htmlFor="email">Email</label>
                <input placeholder= "admin-user@example.com" type="email" name="email" id="" />

                <label htmlFor="password">Password</label>
                <input type="password" name="password" id="" />

            {/* <button type="submit">Register</button> */}
            <NeutralButton type="submit" text="SUBMIT" link= "" />
        </form>


    </div>
  )
}
